import React from 'react';
import {
    GalleryContainer,
    Card,
    Image,
    Title
} from './styles'

interface imageProps {
    src: string;
    alt: string;
    title: string;
}

type Props = {
    images: string[]
}

export const Gallery = ({ images } : Props ) => {
    return (
      <GalleryContainer>
        {images.map((imageSource, index) => (
          <Card key={index}>
            <Image src={imageSource} alt={`Gallery Image ${index + 1}`} />
          </Card>
        ))}
      </GalleryContainer>
    );
};
